import React, { useState } from "react";

const LoginPage = () => {
  const [isLogin, setIsLogin] = useState(true); // Toggle between login and register
  const [username, setUsername] = useState(""); // Username for login/register
  const [password, setPassword] = useState(""); // Password for login/register
  const [email, setEmail] = useState(""); // Email for registration
  const [error, setError] = useState("");

  // Handle Login function
  const handleLogin = async () => {
    console.log(username, password);
    try {
      let result = await fetch("http://localhost:3005/login", {
        method: "post",
        body: JSON.stringify({ username, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });
      result = await result.json();
      console.log(result);
      localStorage.setItem("adminuser", JSON.stringify(result));
      // Navigate to dashboard or home page
    } catch (error) {
      setError("Invalid Username or Password");
    }
  };

  // Handle Register function
  const handleRegister = async () => {
    console.log(username, email, password);
    try {
      let result = await fetch("http://localhost:3005/register", {
        method: "post",
        body: JSON.stringify({ username, email, password }),
        headers: {
          "Content-Type": "application/json",
        },
      });
      result = await result.json();
      console.log(result);
      localStorage.setItem("adminuser", JSON.stringify(result));
      // Handle registration success (e.g., switch to login or redirect)
    } catch (error) {
      setError("Registration failed. Please try again.");
    }
  };

  return (
    <div className="flex justify-center items-center h-screen bg-gray-100">
      <div className="relative w-[400px] h-[500px]">
        <div
          className={`absolute inset-0 bg-white p-8 rounded-lg shadow-lg transition-transform duration-700 ${
            isLogin ? "translate-x-0" : "-translate-x-full"
          }`}
        >
          {/* Login Form */}
          <h2 className="text-2xl font-semibold text-center mb-4">Login</h2>
          <input
            type="text"
            placeholder="Enter Username"
            className="w-full p-2 mb-4 border rounded"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Enter Password"
            className="w-full p-2 mb-4 border rounded"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          {error && <p className="text-red-500 text-sm mb-2">{error}</p>}
          <button
            className="w-full bg-blue-500 text-white py-2 rounded"
            onClick={handleLogin}
          >
            Login
          </button>
          <p className="text-center mt-4">
            Don't have an account?{" "}
            <button
              className="text-blue-500 underline"
              onClick={() => setIsLogin(false)}
            >
              Register here
            </button>
          </p>
        </div>

        <div
          className={`absolute inset-0 bg-white p-8 rounded-lg shadow-lg transition-transform duration-700 ${
            isLogin ? "translate-x-full" : "translate-x-0"
          }`}
        >
          {/* Register Form */}
          <h2 className="text-2xl font-semibold text-center mb-4">Register</h2>
          <input
            type="text"
            placeholder="Enter Username"
            className="w-full p-2 mb-4 border rounded"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="email"
            placeholder="Enter Email"
            className="w-full p-2 mb-4 border rounded"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <input
            type="password"
            placeholder="Enter Password"
            className="w-full p-2 mb-4 border rounded"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          {error && <p className="text-red-500 text-sm mb-2">{error}</p>}
          <button
            className="w-full bg-blue-500 text-white py-2 rounded"
            onClick={handleRegister}
          >
            Register
          </button>
          <p className="text-center mt-4">
            Already have an account?{" "}
            <button
              className="text-blue-500 underline"
              onClick={() => setIsLogin(true)}
            >
              Login here
            </button>
          </p>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
